You are invited to tender for the above titled project. The brief comprises replacement of expired external roof coverings which are currently deemed unsafe,  to the University of Sheffield (UOS) University Arms, public house building.  

The works are to be delivered in a single section under and are briefly outlined below: 

The scope of these works include:
 Re-roofing to all pitched and flat roof areas including replacement of all leadwork and new rafter level insulation;
 Re-bedding of gable coping stones using mechanical fixings;
 Replacement of existing cast-iron rainwater goods where necessary, and removal of redundant downpipes;
 Repairs to chimney brickwork including re-pointing;
 Refurbishment of timber framed dormer windows;
 Replacement of existing timber rooflight.

*Please note the above list is not exhaustive.

Further information about the requirements are in the tender documents. 

The Invitation to Tender (ITT) can be downloaded by registering and expressing your interest on the University`s e-tendering system https://in-tendhost.co.uk/Sheffield. The tender documents provide full information, which will be sent to you once you have expressed your interest. If you have any questions or comments in relation to this tender they must be submitted via the In-tend System, this can be accessed at https://in-tendhost.co.uk/Sheffield. Completed tenders must be returned through the Intend e-tendering system.

Additional information: All tender documents can be accessed at: https://in-tendhost.co.uk/sheffield

